INSERT INTO `alternatif` (`id_alternatif`, `nama`) VALUES
('0001', 'Protein [Rekomendasi makanan rendah protein : apel, pisang, buah berry, alpukat] [Sayuran: brokoli, paprika] [Vitamin : Vitamin B, omega-3, zat besi] [Jenis olahraga : Latihan beban] '),
('0002', 'Kalori [Rekomendasi makanan rendah kalori : Brokoli, bayam, semangka, stroberi, susu] [Vitamin : Vitamin B kompleks, vitamin C, vitamin D] [Jenis olahraga : Latihan kardiovaskular]'),
('0003', 'Karbohidrat  [Rekomendasi makanan rendah karbohidrat : daging, ayam, telur, ikan] [Sayuran: wortel, timun, asparagus, labu siam] [Vitamin : Vitamin C, vitamin E] [Jenis olahraga : Latihan kardiovaskular]'),
('0004', 'Air [Rekomendasi makanan kandungan air rendah : Buah-buahan segar, timun, asparagus, sup kaldu, daging tanpa lemak, ayam tanpa kulit] [Vitamin : Vitamin C, elektrolit] [Kegiatan : Minum air putih secara teratur, hindari minuman berkafein dan beralkohol] '),
('0005', 'Berat Badan Ideal [Rekomendasi untuk menjaga pola makan sehat dengan mengkonsumsi protein, karbohidrat dan vitamin secara seimbang dan olahraga yang cukup seperti kardio untuk membakar lemak]'),
('0006', 'Dinyatakan Kekurangan Gizi [Rekomendasi makanan bergizi seperti: kacang-kacangan, daging merah, umbi-umbian, jagung, serta protein hewani dan nabati lainnya] [Vitamin: vitamin A dan D] [Hindari gula, garam, dan berbagai produk olahan tepung karena menambah kalori secara signifikan] [Jenis olahraga : Latihan massa otot]');
